import './App.css';
import {BrowserRouter, Redirect, Route, Switch} from "react-router-dom";
import Task from "./components/Task";
import Admin from "./components/Admin";
import User from "./components/User";
import MainPage from "./components/Main page";

function App() {
    return (
        <div className="App">
            <BrowserRouter>
                <Switch>
                    <Route path="/task">
                        <Task/>
                    </Route>
                    <Route path="/admin">
                        <Admin/>
                    </Route>
                    <Route path="/user">
                        <User/>
                    </Route>
                    <Route path="/">
                        <MainPage/>
                    </Route>
                    <Redirect to="/"/>
                </Switch>
            </BrowserRouter>
        </div>
    );
}

export default App;
